    public List<ReviewSubmittedEventResponse> getReviewSubmittedEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(REVIEWSUBMITTED_EVENT,
                transactionReceipt);
        ArrayList<ReviewSubmittedEventResponse> responses = new ArrayList<ReviewSubmittedEventResponse>(
                valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            ReviewSubmittedEventResponse typedResponse = new ReviewSubmittedEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.reviewId = (BigInteger) eventValues.getIndexedValues().get(0).getValue();
            typedResponse.reviewer = (String) eventValues.getIndexedValues().get(1).getValue();
            typedResponse.productId = (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.nftId = (BigInteger) eventValues.getNonIndexedValues().get(1).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

